import React from 'react';

import { View,Text,StyleSheet } from 'react-native';


const Item = ({item})=>{

    return(
        <View style={styles.ListItem}>
            <View styles={styles.ListContent}>
                <Text>Number: <Text>{item.name}</Text> </Text>
                <Text>date_order:{item.date_order} </Text>
                <Text>partner_id: {item.partner_id}  </Text>
                <Text>amount_total: {item.amount_total} </Text>
                <Text>state: {item.state} </Text>
            </View>
    </View>
    );
    
}
export default Item;

const styles = StyleSheet.create({
    ListItem:{
        flexDirection:'row',
        justifyContent:'center',
        marginVertical:20
    }
})
